import React from 'react';
import './App.css';

function Child(props) {
  return <div>{props.motherName}</div>
}

function Mother () {
  const name = '김부선';
  return (
  <div>
    <div>엄마입니다.</div>
    <Child motherName={name}/>
  </div>
  )
}

function GrandFather() {
  return (
  <div>
    <div>나는 할아버지입니다.</div>
    <Mother />
  </div>
  )
}

function App() {
  return <GrandFather />;
}

export default App;
